import React,{Component} from "react";

class Users extends Component{
    render(){
        return(
            <table className="table">
            <thead className="table-dark">
                <tr>
                <th scope="col">id</th>
                <th scope="col">Name</th>
                <th scope="col">Email</th>
                <th scope="col">Delete</th>
                </tr>
            </thead>
            <tbody>
            </tbody>
            </table>
        );
    }
}
export default Users;
